(1, 'https://www.facebook.com/', 'ફેસબુક-લોગ ઇન અથવા સાઈન અપ', 'એકાઉન્ટ બનાવો અથવા Facebook પર લૉગ ઇન કરો. મિત્રો, કુટુંબીઓ અને તમે ઓળખતા હોય તે અન્ય લોકો સાથે જોડાઓ. ફોટા અને વિડિઓ શેર કરો, સંદેશા મોકલો અને અપડેટ મેળવો.', '', 0),
(2, 'https://www.facebook.com/recover/initiate?lwv=110&ars=royal_blue_bar', 'પાસવર્ડ ભૂલી ગયાં | લૉગ ઇન કરી શકતાં નથી | ફેસબુક', '', '', 0),
(3, 'https://facebook.com/legal/terms/update', 'સેવાની શરતો', 'તમારા દ્વારા Facebook તથા અમે ઑફર કરીએ છીએ તે ઉત્પાદનો, સુવિધાઓ, એપ્લિકેશનો, સેવાઓ, ટેકનોલોજી અને સૉફ્ટવેરના ઉપયોગનું સંચાલન કરતી Facebook ની સેવાની શરતો...', '', 0),
(4, 'https://facebook.com/about/privacy/update', 'ડેટા નીતિ', 'Facebook કયા પ્રકારની માહિતી મેળવે છે અને કેવી રીતે તેનો ઉપયોગ અને શેર કરે છે તે સહિત Facebook ની ગોપનીયતા નીતિ અને સ્થાપિત પદ્ધતિઓ વિશે વધુ જાણો.', '', 0),
(5, 'https://facebook.com/policies/cookies/', 'કુકીઝ નીતિ', 'Facebook ને પ્રાપ્ત થનારી માહિતીના પ્રકાર અને માહિતીનો ઉપયોગ કેવી રીતે થાય છે અને શેર કરવામાં આવે છે તે સહિત Facebook ની ગોપનીયતા નીતિ અને સિદ્ધાંતો વિશે...', '', 0),
(6, 'https://facebook.com/pages/create/?ref_type=registration_form', 'Facebook', '', '', 0),
(7, 'https://hi-in.facebook.com/', 'Facebook - लॉग इन या साइन अप करें', 'एक खाता बनाएँ या Facebook में लॉग इन करें. अपने मित्रों, परिवार के लोगों और अन्य परिचितों से जुड़ें. फ़ोटो और वीडियो साझा करें, संदेश भेजें और अपडेट पाएँ.', '', 0),
(8, 'https://mr-in.facebook.com/', 'Facebook - लॉग इन किंवा साइन अप', 'खाते तयार करा किंवा  Facebook वर  लॉग इन करा.  मित्र, कुटूंब अाणि आपण ओळखत असलेल्‍या अन्‍य लोकांशी कनेक्‍ट व्‍हा. छायाचित्रे आणि व्हिडिओ सामायिक करा,...', '', 0),
(9, 'https://ur-pk.facebook.com/', '‫Facebook - لاگ ان کریں یا سائن اپ کریں‬', 'اکاؤنٹ بنائیں یا Facebook میں لاگ ان کریں۔ اپنے دوستوں، اہل خانہ اور دیگر جاننے والوں سے جڑیں۔ تصاویر اور ویڈیوز شیئر کریں، میسج کریں اور تازہ ترین...', '', 0),
(10, 'https://ml-in.facebook.com/', 'Facebook - ലോഗിൻ ചെയ്യുക അല്ലെങ്കില്‍ സൈനപ്പ് ചെയ്യുക', 'Facebook-ല്‍ അക്കൗണ്ട്‌ സൃഷ്ടിക്കുകയോ ലോഗ് ഇന്‍ ചെയ്യുകയോ ചെയ്യൂ. സുഹൃത്തുക്കളുമായും കുടുംബവുമായും പരിചയമുള്ള മറ്റ് വ്യക്തികളുമായും കണക്‌റ്റുചെയ്യൂ....', '', 0),
(11, 'https://bn-in.facebook.com/', 'Facebook - লগ ইন করুন অথবা নিবন্ধন করুন', 'একটি অ্যাকাউন্ট তৈরি করুন অথবা Facebook লগ ইন করুন। আপনার পরিচিত বন্ধু, পরিবার এবং অন্যান্য মানুষের সাথে সংযোগ স্থাপন করুন। ফটো এবং ভিডিও শেয়ার করুন,...', '', 0),
